import './Register.css';

function Register() {
  return (
    <div className="container">
        <div>
            Enter Username: <br/>
            <input></input>
        </div>
        <div>
            Enter Password: <br/>
            <input></input>
        </div>
        <div>
            Confirm Pasword: <br/>
            <input></input>
        </div>
    </div>
  );
}

export default Register;
